import React from "react";

const ColorOutput = ({ colors }) => {
   return (
    <div>
        <div style={{backgroundColor: colors[0]}}>test</div>
        <div style={{backgroundColor: colors[1]}}>test</div>
        <div style={{backgroundColor: colors[2]}}>test</div>
        <div style={{backgroundColor: colors[3]}}>test</div>
        <div style={{backgroundColor: colors[4]}}>test</div>
    </div>
   )
}

export default ColorOutput;
